<span class="line"><span style="color:#FFCB6B;">BankAccount</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">:</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">+</span><span style="color:#82AAFF;">deposit</span><span style="color:#89DDFF;">(</span><span style="color:#C792EA;">amount</span><span style="color:#89DDFF;">)</span></span>
