<span class="line"><span style="color:#A6ACCD;">    </span><span style="color:#89DDFF;">+</span><span style="color:#C792EA;">BigDecimal</span><span style="color:#A6ACCD;"> </span><span style="color:#FFCB6B;">balance</span></span>
